value:
@Ethan: Man you are an awesomely chill dude and it was great working with you when we coworked together. I feel like since this was such an individual project that I did not get to experience you as a coder at 100% or get as much interaction as I wanted with you. 

I want to work with you b/c you flow like water, have no projected judgements about people, are very nice to interact with and if I was on an intensive coding project that we would work very well together.

I would like to work more with you if you tried to include team mates a bit more, co working together was nice. However we did not have enough of it this week and part of that was because we did not have a compromise in our environment, which I wish we would have discussed more in hindsight. ie I like light side, you like dark side :)
